// Offers from Egregora APP 
$(document).ready(function() {
  // Returns successful
  $.ajax('https://api.egregora.app/store/products/feed?company_id=ec90b423-1c37-42bc-969c-49f24763ce30&page=1', {
    type: 'GET',
    headers: { 'Content-Type': 'application/json' },
    crossDomain: true,
  })
    .done(function(data) {
      const formatter = new Intl.NumberFormat('pt-BR', {
        minimumFractionDigits: 2
      });

      //console.log(data);
      data.data.map(function(promo) {
        $("#promocoes").append('<div class="promocao">'
        +'<div class="image"><img src='+promo.attributes.images.square+' alt='+promo.attributes.name+'</img></div>'
        +'<div class="name">'+promo.attributes.name+'</div>'
        +'<div class="price">De: R$ '+formatter.format(promo.attributes['regular-price'])+'</div>'
        +'<div class="disc-price">Por: R$ '+formatter.format(promo.attributes['discount-price'])+'</div>'
      +'</div>');
      });
    })
    .fail(function(xhr, status, error) {
      //console.log('promocao nao cadastrada');
    });
});
$(document).ready(function() {
 
    // determine the number of slides
    const slideNum = $('.testimonial-slide').length;
    // add the correct number of dots
    let $dot = $('<div href="javascript:void(0);" class="nav-dot"></div>');
    for(i = 1; i <= slideNum; i++) {
      if(i == 1) {     
         $('.dots').append($dot.clone().addClass('active-dot').addClass('dot' + i));
       }
      else if(slideNum != i) {
        $('.dots').append($dot.clone().addClass('dot' + i));
      }
      else {
        $('.dots').append($dot.clone().addClass('dot' + i));
      }
    }
    // set the width of the reel
    $('.slide-reel').css('width', slideNum * 100 +'%');
    // fade 'er in
    $('.testimonial-stage').fadeIn('slow');
    
    
    function nextSlide() {
      
     // determine what the position of the last slide is
      let frameWidth = parseInt($('.testimonial-frame').css('width'));
      let lastSlidePos = (frameWidth * (slideNum - 1) * -1);
      // get the current slide position
      let slidePosition = parseInt($('.slide-reel').css('left'));
      
      // console.log(lastSlidePos, slidePosition);
      
      if(lastSlidePos != slidePosition) {
        // advance to the next slide - add the width of the frame to the current position)
        $('.slide-reel').css('left', ((frameWidth + Math.abs(slidePosition)) * -1) + 'px');
      }
      else {
       $('.slide-reel').css('left',  0 + 'px');
      } 
      
    }
    
    function prevSlide() {
      
     // determine what the position of the last slide is
      let frameWidth = parseInt($('.testimonial-frame').css('width'));
      let lastSlidePos = (frameWidth * (slideNum - 1) * -1);
      // get the current slide position
      let slidePosition = parseInt($('.slide-reel').css('left'));
      
      // console.log(lastSlidePos, slidePosition);
      
      if(slidePosition !== 0) {
        // advance to the next slide - add the width of the frame to the current position
        $('.slide-reel').css('left', slidePosition + Math.abs(frameWidth) + 'px'); 
      }
      else {
       $('.slide-reel').css('left', lastSlidePos + 'px');
      }
      
    }
    
    function nextDot() {
      // deactivate the current dot
      let currentDot = $('.active-dot');
      
      if(currentDot.hasClass('dot' + slideNum) === false) {
        currentDot.removeClass('active-dot');
        // assign to next dot
        currentDot.next().addClass('active-dot'); 
      }
      else {
        currentDot.removeClass('active-dot');
        $('.nav-dot:first-child').addClass('active-dot');
      }
    }
    
    function prevDot() {
      // deactivate the current dot
      let currentDot = $('.active-dot');
      
      if(currentDot.hasClass('dot1') === false) {
        currentDot.removeClass('active-dot');
        // assign to next dot
        currentDot.prev().addClass('active-dot');
      }
      else {
        currentDot.removeClass('active-dot');
        $('.nav-dot:last-child').addClass('active-dot');
      }
    }
    
    function stopButtons() {
      $('.next-button').css('opacity','0.5');
        $('.next-button').off('click', nextThings);
        $('.prev-button').off('click', prevThings);
      setTimeout(function() {
        $('.next-button').css('opacity','1');
        $('.next-button').on('click',nextThings);
        $('.prev-button').on('click', prevThings);
      }, 1000);
    }
    
    function nextThings() {
      stopButtons();
      nextSlide();
      nextDot();
    }
    
     function prevThings() {
       stopButtons();
      prevSlide();
      prevDot(); 
     }
    
    // click handlers
     $('.next-button').on('click',nextThings);
     $('.prev-button').on('click', prevThings);
       
  });












$(function() {
  //Header Background
  function menuBackground() {
    var scroll = $(window).scrollTop();
    if (scroll > $('#header').height()) {
      $('#header').addClass('with-background');
    } else {
      $('#header').removeClass('with-background');
    }
  }
  menuBackground();
  $(window).scroll(function() {
    menuBackground();
  });

  //Carrousel
  $('#carousel .topbrands-carousel').owlCarousel({
    loop: true,
    autoplay: true,
    nav: true,
    responsive: {
      300: { items: 1 },
      500: { items: 2 },
      768: { items: 3 },
      991: { items: 4 },
    },
  });

  // Navigate do Content
  var hashTagActive = '';
  $('#menu li a').on('click touchstart', function(event) {
    if (hashTagActive != this.hash) {
      var dest = 0;
      if ($(this.hash).offset().top > $(document).height() - $(window).height()) {
        dest = $(document).height() - $(window).height();
      } else {
        dest = $(this.hash).offset().top;
      }
      //go to destination
      $('html, body').animate(
        {
          scrollTop: dest - 85,
        },
        500,
        'swing',
      );
      hashTagActive = this.hash;
    }
    // $(".navbar-collapse").collapse('hide');
  });
  // Navigate do Content Mobile Menu
  var hashTagActive = '';
  $('#menu .btn-menu').on('click touchstart', function(event) {
    if (hashTagActive != this.hash) {
      var dest = 0;
      if ($(this.hash).offset().top > $(document).height() - $(window).height()) {
        dest = $(document).height() - $(window).height();
      } else {
        dest = $(this.hash).offset().top;
      }
      //go to destination
      $('html, body').animate(
        {
          scrollTop: dest - 85,
        },
        300,
        'swing',
      );
      hashTagActive = this.hash;
    }
    // $(".navbar-collapse").collapse('hide');
  });

  // Contact Form Validation
  $('#contact-form').validate({
    rules: {
      name: 'required',
      email: {
        required: true,
        email: true,
      },
      phone: 'required',
      message: 'required',
    },
    messages: {
      name: 'Preencha o campo nome.',
      email: 'Preencha um e-mail válido.',
      phone: 'Preencha o campo telefone.',
      message: 'Preencha o campo mensagem.',
    },
  });

  // Phone input mask
  var SPMaskBehavior = function(val) {
      return val.replace(/\D/g, '').length === 11 ? '(00) 00000-0000' : '(00) 0000-00009';
    },
    spOptions = {
      onKeyPress: function(val, e, field, options) {
        field.mask(SPMaskBehavior.apply({}, arguments), options);
      },
    };
  $('.phone').mask(SPMaskBehavior, spOptions);

  // Contact Form Submit
  $(document).on('submit', '#contact-form', function(e) {
    e.preventDefault();
    var name = $(this)
      .find("input[name='name']")
      .val();
    var email = $(this)
      .find("input[name='email']")
      .val();
    var phone = $(this)
      .find("input[name='phone']")
      .val();
    var message = $(this)
      .find("textarea[name='message']")
      .val();
    var button = $(this).find("button[type='submit']");
    var buttonText = button.text();

    button.prop('disabled', true);
    button.html('Aguarde...');
    // Returns successful data submission message when the entered information is stored in database.
    $.ajax('https://89poc32quj.execute-api.us-west-2.amazonaws.com/prod/sendMail', {
      type: 'POST',
      data: JSON.stringify({ name, email, subject: phone, message }),
      headers: { 'Content-Type': 'application/json' },
      crossDomain: true,
    })
      .done(function(data) {
        $(this).trigger('reset');
        swal('Mensagem Enviada!', data, 'success');
        button.prop('disabled', false);
        button.html(buttonText);
      })
      .fail(function(xhr, status, error) {
        swal('Ops!', error, 'error');
        button.prop('disabled', false);
        button.html(buttonText);
      });
  });

  // Menu Active
  $('#menu ul li a').click(function() {
    $('#menu ul li a').removeClass('active');
    $(this).addClass('active');
  });

  // Menu Active on Scrool


  // Menu Mobile Active
  $(document).on('click', '#menu .btn-menu', function() {
    if ($(this).hasClass('active')) {
      $(this).removeClass('active');
      $('#menu ul').removeClass('active');
    } else {
      $(this).addClass('active');
      $('#menu ul').addClass('active');
    }
  });
  //Close Menu after Click in Mobile Menu
  $(document).on('click', '#menu ul.active li a', function() {
    $('#menu .btn-menu').removeClass('active');
    $('#menu ul').removeClass('active');
  });

  // Numbers
  $('.counting').each(function() {
    var $this = $(this),
      countTo = $this.attr('data-count');

    $({ countNum: $this.text() }).animate(
      {
        countNum: countTo,
      },
      {
        duration: 3000,
        easing: 'linear',
        step: function() {
          $this.text(Math.floor(this.countNum));
        },
        complete: function() {
          $this.text(this.countNum);
          //alert('finished');
        },
      },
    );
  });
});
